import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from 'react-router-dom';
import LoginRegister from './components/LoginRegister';
import LawSearch from './components/LawSearch';

function App() {
  const [user, setUser] = useState(null);
  const [logoutMessage, setLogoutMessage] = useState('');

  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            user ? (
              <Navigate to="/search" />
            ) : (
              <LoginRegister setUser={setUser} logoutMessage={logoutMessage} setLogoutMessage={setLogoutMessage} />
            )
          }
        />
        <Route
          path="/search"
          element={
            user ? (
              <LawSearch user={user} setUser={setUser} setLogoutMessage={setLogoutMessage} />
            ) : (
              <Navigate to="/" />
            )
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
